  \"2016-07-15T04:24:13.754971\",\n\t\"name\": \"medicare-enrollment-dashboard\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The CMS Office of Enterprise Data and
  Analytics has developed a new interactive Medicare Enrollment Dashboard, which provides
  current information on the number of Medicare beneficiaries with hospital-medical
  coverage and prescription drug coverage, available for several geographical areas
  including national, state-territory, and county. The hospital-medical coverage data
  can be broken down further by health care delivery (Original Medicare versus Medicare
  Advantage and Other Health Plans) and the prescription drug coverage data can be
  examined by those enrolled in stand-alone Prescription Drug Plans and those enrolled
  in Medicare Advantage Prescription Drug plans. The dashboard includes enrollee counts
  on a rolling 12 month basis and also provides information on yearly trends.</p>n\",\n\t\"license_title\":
